import React from 'react';
import './App.css';  // Ensure this file exists
import UserList from './components/UserList';  // Ensure this component exists
import AboutUs from './components/AboutUs';  // Ensure this component is correctly imported

function App() {
  return (
    <div className="App">
      {/* Display user list including the Navbar and About Us */}
      <UserList />

      {/* Display About Us section */}
      <AboutUs />
    </div>
  );
}

export default App;
